sourcesContent:
import {
	Button,
	Dialog,
	DialogActions,
	DialogTitle,
	FormControl,
	Grid,
	Icon,
	IconButton,
	Input,
	InputAdornment,
	InputLabel,
	Paper,
	TableCell,
	TableHead,
	TableRow,
	Tooltip,
	Tabs,
	Tab,
	Box,
	Typography,
} from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";
import {
	Add,
	Block,
	Save,
	Search,
	Description,
	GetApp,
} from "@material-ui/icons";
import { ConfirmationDialog } from "egret";
import MaterialTable from "material-table";
import React, { Component } from "react";
import { useTranslation } from "react-i18next";
import { TextValidator, ValidatorForm } from "react-material-ui-form-validator";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import "../../../styles/views/_dengueLocation.scss";

import {
	getById,
	getByPageByParentId,
} from "../AdministrativeUnit/AdministrativeUnitService";
import ValidatePicker from "../Component/ValidateSelect/ValidatePicker";
import AsynchronousAutocomplete from "../utilities/AsynchronousAutocomplete";
import {
	addDengueLocation,
	addDengueLocationItem,
	deleteDengueLocationItem,
	getAllDengueLocationItem,
	updateDengueLocation,
	exportExcelVector,
} from "./Re-DengueLocationServices";
import {
	addPatient,
	deletePatient,
	searchByPagePatient,
	exportExcelPatient,
} from "./PatientServices";
import PropTypes from "prop-types";
import ImportExcel from "../Component/ImportExcel/SingleExcelFileUpload";
import PatientDialog from "./PatientDialog";
import DengueLocationItemDialog from "./DengueLocationItemDialog";
import { saveAs } from "file-saver";

toast.configure({
	autoClose: 2000,
	draggable: false,
	limit: 3,
});

const LightTooltip = withStyles(theme => ({
	arrow: {
		color: theme.palette.common.black,
	},
	tooltip: {
		backgroundColor: theme.palette.common.black,
	},
}))(Tooltip);

const requireLabel = item => {
	return (
		<>
			{item}
			<span style={{ color: "red", fontWeight: "bold" }}>*</span>
		</>
	);
};

function MaterialButton(props) {
	const { t } = useTranslation();
	const item = props.item;
	return (
		<div className="none_wrap">
			<LightTooltip
				title={t("general.editIcon")}
				placement="bottom"
				enterDelay={300}
				leaveDelay={200}
				arrow
			>
				<IconButton
					size="small"
					onClick={() => props.onSelect(item, 0)}
				>
					<Icon fontSize="small" color="primary">
						edit
					</Icon>
				</IconButton>
			</LightTooltip>
			<LightTooltip
				title={t("general.deleteIcon")}
				placement="bottom"
				enterDelay={300}
				leaveDelay={200}
				arrow
			>
				<IconButton
