															</IconButton>
														</InputAdornment>
													}
												/>
											</FormControl>
										</Grid>
									)}

									<Grid item md={12}>
										<MaterialTable
											data={patientList}
											labelRowsPerPage={t(
												"general.rows_per_page"
											)}
											columns={columnsPatient}
											localization={{
												body: {
													emptyDataSourceMessage: `${t(
														"general.emptyDataMessageTable"
													)}`,
												},
											}}
											options={{
												selection: false,
												actionsColumnIndex: -1,
												paging: false,
												search: false,
												rowStyle: rowData => ({
													backgroundColor:
														rowData.tableData.id %
															2 ===
														1
															? "#EEE"
															: "#FFF",
												}),
												maxBodyHeight: "350px",
												minBodyHeight: "350px",
												overflowY: "auto",
												padding: "dense",
												toolbar: false,
											}}
											components={{
												Header: props => {
													return (
														<TablePatientHeader
															{...props}
														/>
													);
												},
											}}
										/>
									</Grid>
								</Grid>
							</TabPanel>
						</Paper>
					</Grid>

					<DialogActions>
						<div className="flex flex-middle mr-8">
							<Button
								startIcon={<Block />}
								variant="contained"
								className="mr-12"
								color="secondary"
								onClick={() => this.handleClose()}
							>
								{t("general.cancel")}
							</Button>
							<Button
								startIcon={<Save />}
								variant="contained"
								className="mr-8"
								color="primary"
								type="submit"
							>
								{t("general.save")}
							</Button>
						</div>
					</DialogActions>
				</ValidatorForm>
			</div>
		);
	}
}
export default DengueLocationForm;
